import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const AddReplacement = () => {
  return (
    <View>
      <Text>AddReplacement</Text>
    </View>
  )
}

export default AddReplacement

const styles = StyleSheet.create({})
